import React from "react";
import styled from "styled-components";

const Container = styled.div`
  padding: 2rem;
`;

const Heading = styled.h2`
  font-size: 2rem;
  margin-bottom: 1rem;
`;

const HomePage = () => {
  return (
    <Container>
      <Heading>Welcome to LokalNottoden</Heading>
      <p>This is your local business directory!</p>
    </Container>
  );
};

export default HomePage;
